import React, { Component } from 'react';
import Modal from 'react-awesome-modal';

export default class UploadPopUp extends Component {
    constructor(props) {
        super(props);
        this.state = {
            visible : false,
            users: null
        }
        this.id = props.id;
    }
   
    componentDidMount(){
        const options = {
            method: "GET",
            headers: {
                "Content-Type": "application/json"
            }
        }
        fetch("http://localhost:5000/api/users/"+this.props.currentTab, options)
        .then(response => response.json())
        .then(json => {
            console.log(json)
        })
    }

    openModal() {      
        this.setState({
            visible : true,
        });
    }

    closeModal() {
        this.setState({
            visible : false,
        });
    }

    render() {
        return (
            <section style={{float:"left"}}>
                <button value="Force claim" className="btn btn-sm btn-warning" style={{marginRight:"5px", marginLeft:"5px", width:"110px", float: "left"}} onClick={() => this.openModal()}>Force unclaim</button>                <div>
                    <Modal visible={this.state.visible} width="650" height="800" effect="fadeInUp" onClickAway={() => this.closeModal()}>
                        
                    </Modal>
                </div>
            </section>
        );
    }
}
